import logo from './logo.svg';
import './App.css';
import 'leaflet/dist/leaflet.css';
import { MapContainer, TileLayer, Marker, Popup, Polygon,Polyline } from 'react-leaflet'
function App() {
  const multiPolygon = [

                 [109.143287658692, 13.7975568771362],
                [109.135925292969, 13.7952919006348],

  ]
  const purpleOptions = { color: 'purple' }
  const position = [109.152381896973, 13.8204851150513]
  return (
    <div className="App">
      <MapContainer   style={{ height: '100vh', width: '100wh' }} center={position} zoom={11} scrollWheelZoom={false}>
  <TileLayer
    attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
  />

  <Marker  center={position} position={position}>
    <Popup>
      A pretty CSS3 popup. <br /> Easily customizable.
    </Popup>
  </Marker>
  <Polyline pathOptions={purpleOptions}  />
</MapContainer>
    </div>
  );
}

export default App;
